// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import Sapp from './Sapp'; // 导入 Sapp 组件
import 'bootstrap/dist/css/bootstrap.min.css'; // 如果你使用 Bootstrap

ReactDOM.render(
  <React.StrictMode>
    <Sapp />
  </React.StrictMode>,
  document.getElementById('root')
);
